Mighty Planes - Season 2

Technology Documentary hosted by Emil Sher, published by Discovery Channel in 2013 - English narration


Information
------------------------------

Mighty Planes explores the art and science of aviation. From preparation, loading, and take off, through the journey, and to the landing and unloading, viewers experience the high-stakes and high-stress jobs through the eyes and lives of the characters that make it all happen. Featuring the genius of flight technology with the aid of high-end CGI and shot in HD.


1)  Omega 707 
This modified Boeing 707 is one of only two 707 tankers in the world that provide commercial air-to-air refuelling to the American military; Omega Aerial Refueling Services was launched in the late 1980s and these tankers are constantly in demand.

2)  P3 Orion 
Slicing through the eye wall of a hurricane, pounded by howling winds, blinded by rain and hail, NOAA's hurricane hunting WP-3D Orion aircraft fly where other planes refuse to venture; witness the action as Hurricane Leslie threatens Bermuda and Canada.

3)  Trump 757 
Travel with Donald Trump aboard his luxurious Boeing 757 on a transatlantic mission to the U.K. for a speech and pit-stop at his new golf course in Scotland; fog, runway curfews and security sweeps are just a few of the challenges faced by Captain Dunkin.

4)  C17 Globemaster III 
The C-17 Globemaster III is the newest, most flexible cargo aircraft to enter the U.S. airlift force; it specializes in quick delivery of troops and all types of cargo and can land and take off on short, rough runways

5)  Sofia 747SP 
In 2010, the largest airborne observatory in the world opened its infrared eye for the first time from aboard a modified Boeing 747 jumbo jetliner; SOFIA boasts a 17-ton telescope capable of making observations impossible for ground-based telescopes.

6)  Blue Angels 
Go behind the scenes as the Blue Angels perform the last two shows of their season; follow this group of Top Guns through the unique, specialized training and delve into the physics of their spectacular aerobatic flying.

